$(document).ready(function(){
  var uri_sef = $('input[name="uri_sef"]').val();



});

Pace.on('done',function(){
	var uri_sef = $('input[name="uri_sef"]').val();
	if (uri_sef != "gallery") {
    home_head_slider();
  }
  img_optimize();
  home_offer_slider();
  home_accommodation_slider();
  home_interest_slider();
  home_why_us_slider();
  home_reviews_slider();

  if ($(window).width() <= 769 || $('.each-accslide').length > 4) {
  	home_accolades_slider();
  }

  dining_slider();
  zeus_control();
  class_manager();

  // lulululu
    parallax_head(uri_sef);

  
  gallery_manager(uri_sef);
  scroll_manja();

  generate_link_booking();

  // NOTE: calendar range picker
  date_picker();
  // date_picker_popup();

  // NOTE: EMAIL MANAGEMENT AJAX
  calendar();
  subscribe_footer();
  inq_dining();
  inq_spa();
  inq_coninfo();
  // END EMAIL MANAGEMENT

  filter_reviews();

  if ($(window).width() >= 769) {
     stroke();
  }

  if ($(window).width() >= 500) {
     opt_review();
  }
  if ($(window).width() <= 500) {
     $('.rev-menus,.o-con a').click(function(){
     	$('.o-con').toggleClass('actv');
     });
  }

  var interval = setInterval(function () {
      var momentNow = moment();
      jQuery('.header-time').html(momentNow.format('hh:mm <i>A ') + '(+08)</i>');
  }, 100);
  // ululul

  $('.the-lord').removeClass('actv');
  $('body').removeClass('god-hand');


});

function opt_review(){
  $('.o-con a').click(function(){
    $('.o-con a').removeClass('actv');
    $(this).addClass('actv');
    $('.jombs').text($(this).text());
    $('.o-con').toggleClass('actv');
  });

  $('.jombs').click(function(){
    $('.o-con').toggleClass('actv');
  });
}

function scroll_manja(){
  var top = $(window).height();
  $('.h-disc').click(function(){
    $('html,body').animate({scrollTop: top - 57},'slow');
  });

  $('.ft-arw-up').click(function(){
    $('html,body').animate({scrollTop: 0},'slow');
  });

}

function stroke(){

  // NOTE: vital bro
  var titiw = $('.hgreet h1').innerWidth();
  if (titiw >= 500) {
    titiw = titiw - 50;}else { titiw = titiw + 10;}
  $('.embel-embel').css('width','calc(100% - '+titiw+'px)');

}

function gallery_manager(urisef){
  // $('.thumbnail-gallery').click(function(){
  // 	$(this).find('a').click();
  // });
  $('.thumbnail-gallery').each(function(){
    $(this).click(function(){

      var dGale = $(this).find('a').attr('data-gale'),
          title = $(this).find('a').parent().find('h2').text();

      $('#hero-adt-slider').find('.slide-bg-hero').remove();
      $('#hero-adt-slider h2').text(title);
      $('.h-adt-slider').append(dGale);

      var tot = $('#hero-adt-slider .slide-bg-hero').length;
      $('#hero-adt-slider span.ac-count b').text(tot);

      home_head_slider();
      setTimeout(function(){
        $('.btg-load').addClass('hide');
        $('.belongs-to-gallery').addClass('actv');
      }, 500);

      $('#hero-adt-slider').addClass('actv');
    })
  });

  if (urisef == "gallery") {
    $('#hero-adt-slider .cls').click(function(){
      $('.btg-load').removeClass('hide');
      $('.belongs-to-gallery').removeClass('actv');
      setTimeout(function(){
        $('.h-adt-slider').slick('unslick');
      }, 300);
    });
  }
}

function img_optimize(){
    var bLazy = new Blazy({
      breakpoints: [{
        width: 768,
        src: 'data-src-m'
      }
      ,
      {
  	    width: 1024,
        src: 'data-src-tab'
	    }]
   });
}

function parallax_head(uri_sef){
  // var top = $("#special-offers").offset().top;
  var top = $(window).height();

  $(window).scroll(function () {

      var st = $(this).scrollTop();

      // PARALAX SCROLL

      if (st >= top) {
        // $('.nav-head').addClass('sage-mode');
      }else{
        // $('.nav-head').removeClass('sage-mode');

        $('.plx-img').css({
            'transform': 'translateY(-' + (st * .5 ) + 'px)'
        });
      }

      if (uri_sef != 'contact-information') {
        if (st>0) {
          if ($('.nav-head').hasClass('sage-mode')) {

          }else {
            $('.nav-head').addClass('temphide');
            setTimeout(function(){
              $('.nav-head').removeClass('temphide');
              $('.nav-head').addClass('sage-mode');
            }, 500);
          }

        }else {
          $('.nav-head').addClass('temphide');
          setTimeout(function(){
            $('.nav-head').removeClass('temphide');
            $('.nav-head').removeClass('sage-mode');
          }, 500);
        }
      }

  });
}

function home_head_slider(){
  var parent = $('.h-adt-slider'),
      option = {
                  slide: '.slide-bg-hero',
                  infinite: true,
                  speed: 500,
                  autoplay : false,
                  draggable: true,
                  dots:false,
                  centerMode: true,
                  variableWidth: true,
                    nextArrow: $('.sh-n.n'),
                  prevArrow: $('.sh-n.p'),
                };

  slickContainer(parent,option);
  var bLazy = new Blazy();
  parent.on('beforeChange', function (event, slick, currentSlide, nextSlide) {
      bLazy.revalidate();
      var elSlide = $(slick.$slides[nextSlide]);
      var numb    = elSlide[0]['attributes']['numb']['nodeValue'];

      $('.ac-count i').text(numb);
  });
}

function home_offer_slider(){
  var parent = $('.so-slider'),
      option = {
                  infinite: true,
                  speed: 500,
                  autoplay : false,
                  draggable: true,
                  dots:false,
                  centerMode: true,
                  variableWidth: true,
                  arrows: false,
                  // nextArrow: $('.nv-r'),
                  // prevArrow: $('.nv-l'),
                };

  slickContainer(parent,option);

  var bLazy = new Blazy();
  parent.on('beforeChange', function (event, slick, currentSlide, nextSlide) {
      bLazy.revalidate();
  });
};

function home_accolades_slider(){
  var parent = $('#acc-slide'),
  option = {
              slide: '.each-accslide',
              infinite: true,
              speed: 500,
              arrows: false,
              autoplay : true,
              draggable: true,
              dots:false,
              variableWidth: true,
              responsive: [
                {
                  breakpoint: 500,
                  settings: {
                    centerMode: true,
                  }
                }
              ]
            };

  slickContainer(parent,option);

  var bLazy = new Blazy();
  parent.on('beforeChange', function (event, slick, currentSlide, nextSlide) {
      bLazy.revalidate();
  });
}

function home_accommodation_slider(){
  var parent = $('.con-acco-slider'),
      option = {
                  infinite: true,
                  speed: 500,
                  autoplay : false,
                  draggable: false,
                  dots:false,
                  variableWidth: true,
                  // arrows: false,
                  nextArrow: $('.kotak .ac-next'),
                  prevArrow: $('.kotak .ac-prev'),
                  responsive: [
                    {
                      breakpoint: 769,
                      settings: {
                        centerMode: true,
                      }
                    }
                  ]
                };

  slickContainer(parent,option);

  var bLazy = new Blazy();

  parent.on('beforeChange', function (event, slick, currentSlide, nextSlide) {
    bLazy.revalidate();
    var elSlide = $(slick.$slides[nextSlide]);
    var title   = elSlide[0]['attributes']['data-title']['nodeValue'];
    var caption = elSlide[0]['attributes']['data-content']['nodeValue'];
    var numb    = elSlide[0]['attributes']['data-numb']['nodeValue'];
    var link    = elSlide[0]['attributes']['data-link']['nodeValue'];

    $('.kotak h3,.kotak p,.ac-count i').removeClass('actv').delay(300).queue(function(next){

          $('.kotak h3').text(title);
          $('.kotak p').text(caption);
          $('.ac-count i').text(numb);
          $('.ac-discover').attr('href',link);
          $('.additional_link').attr('href',link);


          setTimeout(function(){
            $('.kotak h3,.kotak p,.ac-count i').addClass('actv')
          }, 800);
          next();
      });
  });
};

