function date_picker(){
  var d = new Date();
  var month = d.getMonth() + 1;
  var day = d.getDate();

  var output = (('' + month).length < 2 ? '0' : '') + month + '/' +
      (('' + day).length < 2 ? '0' : '') + day + d.getFullYear() + '/';

  $('.thedate').each(function(){
    var drp = 'up';
    if ($(this).hasClass('hhp')) {
        drp = 'down';
    }
    $(this).daterangepicker({
      autoApply: true,
      minDate: output,
      autoUpdateInput: false,
      locale: {
          cancelLabel: 'Clear',
          // format: 'DD/MMM/YYYY',
          direction  : drp,
          daysOfWeek : ["Sun" ,"Mon", "Tue", "Wed" ,"Thu", "Fry", "Sat"],
          monthNames : ["January", "February", "March", "April", "May","June",
                        "July","August","September","October","November","December"]
      },
      drops: drp
    });

    $(this).on('apply.daterangepicker', function (ev, picker) {
        $('.daterangepicker').removeClass('actv');
        $('.flying-book form').fadeIn(300);
        $(this).text(picker.startDate.format('DD MMM') + ' - ' + picker.endDate.format('DD MMM YYYY'));

        $('input[name="checkin"]').val(picker.startDate.format('YYYY-MM-DD'));
        $('input[name="checkout"]').val(picker.endDate.format('YYYY-MM-DD'));
    });

    $(this).click(function(){
      // $('.daterangepicker').toggleClass('actv');
      if ($(this).hasClass('hhd')) {
        if ($('.daterangepicker.drop-up').hasClass('actv')) {
          $('.daterangepicker.drop-up').removeClass('actv');

        }else {
          $('.bparent ul,.lang_opt ul').removeClass('actv');
          $('.daterangepicker.drop-up').addClass('actv');
        }
      }else {
        if ($('.daterangepicker.down').hasClass('actv')) {
          $('.daterangepicker.down').removeClass('actv');
        }else{
          $('.bparent ul,.lang_opt ul').removeClass('actv');
          $('.daterangepicker.down').addClass('actv');
        }
      }
    });
  });

  // NOTE: BOOKING
  $('.minion-pop li').click(function(){
    var th  = $(this),
        txt = th.text(),
        val = th.attr('val');
        prt = th.parents('label');

    prt.find('.cc p').text(txt);
    prt.find('input').val(val);
  });

  $('#popup-book label ul li').click(function(){
    var th  = $(this),
        txt = th.text(),
        val = th.attr('val'),
        prt = th.parents('label'),
        field = prt.attr('attr');

    prt.find('.cc p').text(txt);
    $('input[name="'+field+'"]').val(val);
  });
}

